import KotlinPlayground from "react-kotlin-playground";

const Test = ({value, setValue, handleHtmlChange}) => {
    return (
        <KotlinPlayground mode="kotlin" onChange={(e) => {handleHtmlChange(); setValue(e)}} targetPlatform='js'>
        <pre>
          <code>

                {value}

          </code>
        </pre>
      </KotlinPlayground>
    )
}

export default Test;
